scriptlet.script:
// default response
scriptletResponse = "failure";
scriptletResult = "";

try {
    // check to make sure scriptletInput is defined (if there was a failure, it might not be)
    if (typeof scriptletInput === "undefined" ||  scriptletInput=="" ){
        // if scriptletInput is undefined, thow an empty exception, so the final scriptletResult will be empty
        throw "";
    }


    //jsObject = JSON.parse(scriptletInput);
    scriptletInput = scriptletInput.split(',').join(',\n');
    var taskList = scriptletInput.split('\n');
    var locationOutput ="";
    var third=0;
    var forth=0;
    var dividor=0;


    // Find max availableIpAddressCount
    for (var i = 0; i < taskList.length; i++) {
        dividor=taskList[i].indexOf(':');
        if (taskList[i].indexOf('"name"') >-1) {
            third=taskList[i].indexOf('"',dividor)+1;
            forth=taskList[i].length-2;
            locationOutput=locationOutput+taskList[i].substring(third,forth)+',';
        }
        if (taskList[i].indexOf('"displayName"') >-1) {
            third=taskList[i].indexOf('"',dividor)+1;
            forth=taskList[i].length-2;   
            locationOutput=locationOutput+taskList[i].substring(third,forth)+'|';
        }

    }


    scriptletResult = locationOutput;
    scriptletResponse = "success";
}
catch (e){
    scriptletResult = ""+e;
}

